const Index = () => (
  <div>
    <div className="topbar"></div>
    <p>Hello World!</p>

  <style jsx global>{`
  body {
    background-color: hsl(0, 0%, 7%);
  }

  .topbar {
  backface-visibility: hidden;
  border-bottom: 1px solid #e6ecf0;
  border-bottom: 1px solid rgba(0,0,0,0.05);
  position: fixed;
  top: 0;
  right: 0;
  left: 0;
  z-index: 1000;
  }
`}</style>
</div>
)

export default Index
